import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => (
  <nav>
    <h1>Social Media App</h1>
    <Link to="/">Home</Link>
    <Link to="/add-post">Add Post</Link>
  </nav>
);

export default Navbar;
